description:
Brooke Haven is training for her reality show with the help of War Machine... she was interested in more than MMA.
Office mates Carolyn and Bill have been jogging together after work for three months... Carolyn is now ready to take cardio at home.
Sadie West has never been on a blind date before... luckily for her she met Derrick at the bowling alley and sparks flew.
Jack has been teaching Chayse tennis for a year and feels she is ready for the next level... and that level is hardcore sex.
Alanah gets more than a good workout when she hires Marco as her personal trainer.

Alanah Rae,Carolyn Reese,Sadie West,Chayse Evans,Brooke Haven,Marco Banderas,Derrick Pierce,Jack Lawrence,War Machine

